[Form]
public class InventTurnoverReportSaved_RU extends FormRun
{
    internal InventTurnoverReportSave_RU runBaseReport;
    internal RefRecId sessionId;

    internal DimensionFocusRecId dimensionFocusId;

}

internal InventTurnoverReportArgs_RU createReportArgs()
{
    InventTurnoverReportArgs_RU args = InventTurnoverReportArgs_RU::constructFromSessionId(
        element.args().record().RecId,
        reportLine_DS.queryRun().query(),
        runBaseReport.queryRun().query(),
        runBaseReport.parmFromDate(),
        runBaseReport.parmToDate(),
        dimensionFocusId);

    for (int i = 1; i <= reportGrid.controlCount(); i++)
    {
        FormControl control = reportGrid.controlNum(i);

        if (control.visible())
        {
            FormDataSource fds = control.dataSourceObject();
            FieldBinding fdb = control.fieldBinding();

            if (fds && fdb)
            {
                args.fields().addEnd([fds.table(), fdb.fieldId()]);
            }
        }
    }

    return args; 
}

internal InventTurnoverReportDetail_RU createReportDetail()
{
    InventSumDateFinancialDim_RU inventSumDateFinancialDim;

    inventSumDateFinancialDim.data(reportLine);
    inventSumDateFinancialDim.ItemId = ReportDimLink.ItemId;

    InventTurnoverReportDetail_RU reportDetail = InventTurnoverReportDetail_RU::construct(
        runBaseReport.parmFromDate(),
        runBaseReport.parmToDate(),
        inventSumDateFinancialDim,
        runBaseReport.getActiveDimensions(),
        runBaseReport.queryRun().query());

    reportDetail.parmDimensionFocusId(dimensionFocusId);

    return reportDetail;
}

internal Set getDimActiveFields(List _dimList)
{
    ListEnumerator e = _dimList.getEnumerator();
    Set visibleFields = new Set(Types::Integer);

    while (e.moveNext())
    {
        visibleFields.add(this.getFieldIdExt(e.current()));
    }

    return visibleFields;
}

internal FieldId getFieldIdExt(FieldId _fieldId)
{
    if (fieldExt2Idx(_fieldId) == 0)
    {
        return fieldId2Ext(_fieldId, 1);
    }
    return _fieldId;
}

public void init()
{
    if (!element.args().record() || element.args().dataset() != tableNum(InventTurnoverReportSession_RU))
    {
        throw error(strFmt("@SYS18626", element.name()));
    }

    InventTurnoverReportSession_RU session = element.args().record();

    runBaseReport = InventTurnoverReportSave_RU::construct();

    runBaseReport.unpack(session.Parameters);
    runBaseReport.prepareIdx2DimFieldIdMap();

    sessionId = session.RecId;
    dimensionFocusId = session.InventSumDateFinancialDimensionFocus;

    super();

    this.modifyDesign();

    this.design().caption(strFmt('%1, %2..%3', this.design().caption(), runBaseReport.parmFromDate(), runBaseReport.parmToDate()));

    this.modifyQuery();

}

internal void modifyDesign()
{
    FormDesign design = element.design();
    FormGridControl grid = element.control(element.controlId(formControlStr(InventTurnoverReport_RU, ReportGrid)));
    int controlCnt = grid.controlCount();

    List dimList = List::create(runBaseReport.parmDimensions());
    Set dimActiveFields = this.getDimActiveFields(dimList);
    Map dimFieldId2ControlId = new Map(Types::Integer, Types::Integer);
    FieldId fieldId;

    for (int idx = 1; idx <= controlCnt; idx++)
    {
        Object control = grid.controlNum(idx);

        if (control.dataSource() == design.dataSource(formDataSourceStr(InventTurnoverReport_RU, ReportLine)))
        {
            fieldId = control.dataField();
            control.visible(dimActiveFields.in(fieldId));

            if (control.visible())
            {
                dimFieldId2ControlId.insert(fieldId, control.id());

                if (fieldExt2Id(fieldId) == fieldNum(InventSumDateFinancialDim_RU, Dimension))
                {
                    DimensionAttribute dimAttr = DimensionAttribute::find(
                        DimensionHierarchyLevel::findByDimensionHierarchyAndLevel(dimensionFocusId, fieldExt2Idx(fieldId)).DimensionAttribute);

                    control.label(dimAttr.localizedName());
                }
            }
        }
    }

    Object control = element.control(element.controlId(formControlStr(InventTurnoverReportSaved_RU, ItemId)));
    fieldId = this.getFieldIdExt(fieldNum(InventSumDateFinancialDim_RU, ItemId));
    control.visible(dimActiveFields.in(fieldId));

    if (control.visible())
    {
        dimFieldId2ControlId.insert(fieldId, control.id());
    }

    ListEnumerator e = dimList.getEnumerator();
    int prevControlId = element.controlId(formControlStr(InventTurnoverReportSaved_RU, TotalTrans));

    while (e.moveNext())
    {
        fieldId = this.getFieldIdExt(e.current());

        if (dimFieldId2ControlId.exists(fieldId))
        {
            int controlId = dimFieldId2ControlId.lookup(fieldId);
            grid.moveControl(controlId, prevControlId);
            prevControlId = controlId;

            if (fieldId == this.getFieldIdExt(fieldNum(InventSumDateFinancialDim_RU, ItemId)))
            {
                grid.moveControl(element.controlId(formControlStr(InventTurnoverReportSaved_RU, ItemName)), prevControlId);
                prevControlId = element.controlId(formControlStr(InventTurnoverReportSaved_RU, ItemName));

                this.setItemsVisible();
            }
        }
    }

    this.setTransfersVisible(runBaseReport.parmShowTransfers());
    this.setPhysicalVisible(runBaseReport.parmShowPhysical());
}

internal void modifyQuery()
{
    Query query = reportLine_DS.query();
    QueryBuildDataSource qbdsDim = query.dataSourceTable(tableNum(InventSumDateFinancialDim_RU));
    qbdsDim.clearSortIndex();
    qbdsDim.sortClear();

    QueryBuildDataSource qbdsDimItemLink = query.dataSourceTable(tableNum(InventSumDateFinancialDimItem_RU));
    qbdsDimItemLink.clearSortIndex();
    qbdsDimItemLink.sortClear();

    InventTurnoverReportSession_RU session = element.args().record();
    QueryBuildDataSource qbdsValues = query.dataSourceTable(tableNum(InventTurnoverReportLineData_RU));
    qbdsValues.clearLinks();
    qbdsValues.addLink(fieldNum(InventSumDateFinancialDimItem_RU, RecId), fieldNum(InventTurnoverReportLineData_RU, FinancialDimItemId));
    qbdsValues.addRange(fieldNum(InventTurnoverReportLineData_RU, SessionId)).value(queryValue(session.RecId));
    qbdsValues.clearSortIndex();
    qbdsValues.sortClear();

    List dimList = List::create(runBaseReport.parmDimensions());
    ListEnumerator e = dimList.getEnumerator();

    while (e.moveNext())
    {
        boolean isEnum = new DictField(tableNum(InventSumDateFinancialDim_RU), e.current()).baseType() == Types::Enum;
        if (e.current() == fieldNum(InventSumDateFinancialDim_RU, ItemId))
        {
            qbdsDimItemLink.addOrderByField(fieldNum(InventSumDateFinancialDimItem_RU, ItemId), isEnum ? SortOrder::Descending : SortOrder::Ascending);
        }
        else
        {
            qbdsDim.addOrderByField(e.current(), isEnum ? SortOrder::Descending : SortOrder::Ascending);
        }
    }

    qbdsValues.addOrderByField(fieldNum(InventTurnoverReportLineData_RU, TotalTrans));
}

internal void setItemsVisible()
{
    qtyStart.visible(true);
    qtyReceipt.visible(true);
    qtyIssue.visible(true);
    qtyEnd.visible(true);
    itemName.visible(runBaseReport.parmShowItemName());
}

internal void setPhysicalVisible(boolean _visible)
{
    FormBuildDesign design = form.design();

    physicalQtyReceipt.visible(_visible);
    physicalQtyIssue.visible(_visible);
    physicalAmountReceipt.visible(_visible);
    physicalAmountIssue.visible(_visible);
}

internal void setTransfersVisible(boolean _visible)
{
    transferQtyReceipt.visible(_visible);
    transferQtyIssue.visible(_visible);
    transferAmountReceipt.visible(_visible);
    transferAmountIssue.visible(_visible);
}

public int active()
{
    int ret = super();
    boolean detailEnabled = reportLineData.TotalTrans == TotalTrans::Trans && reportDimLink.ItemId;

    inventTrans.enabled(detailEnabled);
    inventSettlementRecord.enabled(detailEnabled);

    return ret;
}
